import React from "react";
import { Link } from "react-router-dom";

function Login({}) {
  return (
    <div className="sign">
      <p className="sign__title">Вход</p>
      <form className="sign__form">
        <input className="sign__input" required id="username" name="username" type="text" />
        <input className="sign__input" required id="password" name="password" type="password" />
        <input type="submit" className="sign__button" value="Войти" />
      </form>
    </div>
  );
}

export default Login;
